onnection to the database e g mysql real_connect host user password database and so forth the new rule type would be similar to the example in database2model rb the main query is the iterator i e the number of times the bindings are performed but secondary queries may also exist database2model rb creating models from the database rule \''nodes do from dbschema to wiki node mapping do db wnode main query \''select page_id page_title page_namespace page_counter from page\'' queries do q1 \''select count from revision o where rev_page \'' db page_id end wnode editions helper geteditions q1 count wnode node_id db page_id to_i wnode title db page_title wnode node_namespace db page_namespace wnode type helper gettype db page_namespace db page_title wnode visits db page_counter end end creating models from the already created instances wiki categorygraph new name \''categorygraph\'' do catgraph wiki node all_objects each do nodecat if nodecat type \''category\'' catgraph nodes nodecat end end wiki edge all_objects each do edgecat if edgecat to nil if edgecat from type \''category\'' and edgecat to type \''category\'' catgraph edges edgecat end end end end contribution contribution contribution uses cases description description description mapping from the wikimedia schema to the graph metamodel issues issues issues a known problem setting up the system the first time set password for \''root\'' \''localhost\'' old_password \''12345\'' ; update mysql user set password old_password \''12345\'' where host \''localhost\'' and user \''root\''; flush privileges; references references references category rubyev '),
