 (34,'08isev',' background problem statement problem statement problem statement tidy-up and summarize the next ideas are extracted mainly from three articles authors 1 arie van deursen eelco visser jos warmer 2 jeff gray yuehua lin jing zhang 3 boris gruschko dimitrios s kolovos richard f paige core component of model-driven engineering model to code or model to model transformations model refactoring model optimization model refinement and model scalability different approaches for defining transformations u8e28093 direct model manipulation u8e28093 intermediate representation u8e28093 specialized transformation language in the presence of new stakeholder requirements a metamodel undergoes numerous changes during periods of evolution a metamodel defines the valid concepts and rules for constructing a model in a specific domain a metamodel can be instantiated to provide a domain-specific modeling language dsml that is customized to the visual representation and semantics appropriate for a specific domain the evolution of a domain requires that changes be made to the underlying metamodel as metamodel definitions evolve the models and model interpreters that were defined under the previous metamodel are no longer valid under the new metamodel model driven engineering requires multiple dimensions of evolution the promise of mde is the development and maintenance effort can be reduce by working at the model level the aim in development is to produce a high-quality system with the least possible effort the problem is to identify the right abstractions to represent high-level requirements and designs the aim in maintenance is to apply improvements and extensions with the least possible effort the problem is to identify the abstractions that are encoded in the existing implementation in order to correctly make modifications models are an integral part of the software evolution process 1 regular evolution modeling languages is used to make changes 2 meta-model evolution changes are required to the modeling language to improve its expressivity such changes may require migration of models first premise software evolution should be a continuous process after developing a number of systems using a particular meta-model new patterns may be recognized that can be captured in a higher-level or richer meta-model second premise reengineering of legacy systems to the model-driven paradigm should be a special case of this continuous evolution incrementally model interaction to achieve modularity we need separation of concerns into different models which implies dependencies between models a system may only be partially defined by models with the rest defined with gpl code which implies dependencies between models and code dependencies should be formalized and checkable before code generation traceability in our case with rubytl trace_query mechanism a model should publish an interface that custom code and other models can use to interact with the model the key innovation that modeldriven software evolution requires is a unification of reverse engineering program transformation code generation and model transformation techniques other approach two key challenges in supporting evolution in model-driven engineering 1 the emergence of crosscutting properties that are projected across a model hierarchy and 2 scalability issues that concern the expansion of a base model two categories of change evolution the first category pertains to concerns that crosscut the hierarchy of the model representation such changes require the model engineer to visit multiple locations in the model in order to address a specific concern the application of aspect-oriented techniques at the modeling level can provide a solution to this type of evolution by modularizing the crosscutting property second category of change evolution concerns the issue of scalability where a base model is replicated to expand the size of a model this type of change requires the creation of multiple modeling elements and the appropriate connections between them the language should be domain- and user-centered the language should be specific to model transformation automated model scalability a second form of design exploration involves scaling up different parts of a model model can have multiple thousand of coarse grained components scalability affects the performance of the modeling activity as well as the correctness of the model representation model transformation can provide a common technology for implementing various kinds of model evolution one more metamodel evolution poses a threat to the applicability of model-driven development to large scale projects the problem is caused by incompatibilities between metamodel revisions these render models that conform to the older version of the metamodel non-conformant to the newer version an approach to addressing this problem is co-evolution of models with their respective metamodels metamodeling is the cornerstone of model-driven development mdd metamodels are used to formalize the artefacts of the mdd process like all software artefacts metamodels typically evolve during a software development project due to the progressively enhanced understanding of the problem domain and how it should be modelled however changes introduced when evolving a metamodel can invalidate the models that conform to its previous version the meta object facility mof is a metamodelling architecture that supports rigorous definition of modelling languages mof introduces four abstraction levels numbered m3-m0 m1 model erosion is caused by changes in the corresponding m2 model m2 models can change in several ways some of these changes are additive and as such they do not break the corresponding m1 models other changes introduce incompatibilities and cross-version inconsistencies therefore invalidating or u8e2809cbreakingu8e2809d m1 models as a consequence the broken m1 models cannot be imported by the modelling infrastructure which is aware of the newer m2 model version only to address this issue the m1 instances of the changed m2 model have to be migrated to the newer m2 model version changes in m2 models u8e280a2 not breaking changes changes which occur in the m2 model but donu8e28099t break its instances u8e280a2 breaking and resolvable changes changes which do break the m2 model instances but can be resolved by automatic means u8e280a2 breaking and unresolvable changes changes which do break the m2 model instances and can not be resolved automatically  renames  refer to changes affecting the names of m2 model elements these changes should be automatically resolvable  deletion of m2 objects  deleting an object from the m2 level may mean that the information it captures is now obsolete and consequently its instances should also be removed from m1 models on the other hand the act of deleting an object may be part of a larger-scale activity e g a refinement in this case information from the instances of the now deleted m2 object may need to be stored elsewhere in the m1 models the deletion of m2 objects requires intervention in order to delete the corresponding m1 instances  the addition  of m2 objects is an additive change therefore no intervention during the migration is needed exceptions can occur if the m2 model contains constraints which explicitly disallow the presence of certain m2 objects  movement  of an m2 object amounts to a deletion of one and creation of another m2 object with the same type and attribute values this solution implies the loss of all existing m1 instances of the moved object the m1 instances of the concerned m2 object have to be migrated to refer to the new m2 object location a distinction between movements which do not change the number of m1 instances and those changing the number of m1 instances has to be made the former requires the translation of links to the m2 objects only an example of such change is the movement of an m2 class to another package an example of an m2 change requiring the alternation of the number of m1 instances is the movement of an attribute from one m2 class to another m2 class  associations  of two m2 classes tend to be either additive or breaking and not-resolvable if the cardinality is being extended e g from 1 n to 0 n then the corresponding m1 models will not be broken if the cardinality is being restricted e g from 0 n to 1 n then every link set in the m1 model with zero links will become invalid a human operator has to decide about the creation of new links  attribute types  for primitive types a mapping can be created to allow for an automatic migration firstly the differences between two m2 model versions need to be determined secondly an appropriate algorithm for model migration has to be determined finally the determined migration algorithm is to be executed 1 change detection or tracing the m2 model versions are compared and the differences are translated into the delta model 2 classification the found changes are classified into categories 3 user input gathering the user input needed for not automaticaly resolvable changed migration is gathered 4 algorithms determination the algorithms required for the migration are determined 5 migration the migration is executed change detection direct comparison two versions of the m2 model as input and delivers the set of changes between them the comparison of two m2 models would only yield a useful result when model elements possess unique identifiers the second method takes the older version of the m2 model and a trace of change operations as input the direct comparison do not need a change trace recording capability the algorithms required to perform the comparison are more complex and will not always deliver the desired result the changes trace method requires keep track of changes performed on the m2 model this method provides the capability to track model element moves in absence of unique element identifiers the set of changes is to be maintained as an instance of the change m2 model the eclipse modeling framework provides a change metamodel designed to capture changes on instances of ecorebased m2 models in this papers they explain strategies for avoiding manually writing of trivial rules  u8c2bfpor quu8c3a9 es interesante este tema u8c2bfcuu8c3a1l es el problema por resolver premisas de partida  contribution contribution contribution in a first stage a transformation from the catalog model to the blog model is shown it can be used any of the transformation language but we use rubytl this transformation could have been done with other transformation language because we do not use exclusive mechanism of rubytl this is attractive for developers in other transformation languages in the catalog metamodel there are link subtypes existinginternallink nonexistinginternallink and externallink for the transformations that are not for model evolution will be used existinginternallink and externallink for the transformations that are for model evolution will be used nonexistinginternallink and externallink that is because the links will be done between different models crossing models in a second stage the trace query mechanism will be used as solution to model evolution to distinguish between the model transformation and model evolution transformation we use the links check the solution way with atl or references to articles which have done it  u8c2bfcu8c3b3mo pretendemos resolver el problema hipu8c3b3tesis  uses cases en caso de ser aplicable uses cases en caso de ser aplicable uses cases en caso de ser aplicable explain in depth we have got a catalog of products and we are going to transform it into a blog of products with model transformation roughly a catalog has categories products attributes values and links which are transformed into a blog that has categories posts metadata and trackbacks at the beginning there was not any problem the whole catalog was transformed into a blog but the problem arises when new products are added to the catalog there is no need to create a whole blog again to do the complete process creating the same categories the same posts just to add new products if it is needed to do regularly it is a waste of time here appears the necessity of evolution reusing the transformations and modifying the metamodel adding new metaclasses and predicting the necessity of evolution so there are different models that need interchange information between them e g for links between the products for cross selling to know about the categories traceability should be permanent trace_query mechanism imagen metacatalog png figure 1 metamodel of catalog imagen metablog png figure 2 metamodel of blog imagen metaoperationscatalog png figure 3 metamodel of operationscatalog imagen metaoperationsblog png figure 4 metamodel of operationsblog imagen sqlmeta png figure 5 sql metamodel imagen sequencediagram png figure 6 sequence diagram transformation from catalog to blog and to sql saving the traces imagen sequencediagram2 png figure 7 sequence diagram adding new products using the traces to the blog and updating the sql database imagen quickview png figure 8 quick view think about metamodels how to use the same for the source and the same for the target with filters it it\''s needed first_blog xmi and second_blog xmi conform the same metamodel  escenarios donde se da el problema y cu8c3b3mo nuestra contribuciu8c3b3n lo mitiga  description description description descripciu8c3b3n detallada de la contribuciu8c3b3n puede haber varias secciones dependiendo del tema issues issues issues aspectos que tal vez no se abordan todavu8c3ada pero que nos hemos topado con ellos references references references referencias en  del icio us  conferences conferences conferences models icmt ecmda related works related works related works model-driven software evolution reuniu8c3b3n murcia revisiu8c3b3n artu8c3adculo reuniu8c3b3n murcia revisiu8c3b3n artu8c3adculo reuniu8c3b3n murcia revisiu8c3b3n artu8c3adculo cambiar la introducciu8c3b3n mencionar hot model co-evolution a hot-based architecture category rubyev '),
